/* Effect 1: Brackets */
a.hkd-link-1:before,a.hkd-link-1:after{display:inline-block;opacity:0;-webkit-transition:-webkit-transform 0.3s,opacity .2s;-moz-transition:-moz-transform 0.3s,opacity .2s;transition:transform 0.3s,opacity .2s}
a.hkd-link-1:before{margin-right:10px;content:'[';-webkit-transform:translateX(20px);-moz-transform:translateX(20px);transform:translateX(20px)}
a.hkd-link-1:after{margin-left:10px;content:']';-webkit-transform:translateX(-20px);-moz-transform:translateX(-20px);transform:translateX(-20px)}
a:hover.hkd-link-1:before,a:hover.hkd-link-1:after,a.hover.hkd-link-1:before,a.hover.hkd-link-1:after{opacity:1;-webkit-transform:translateX(0px);-moz-transform:translateX(0px);transform:translateX(0px)}

/* Effect 2: 3D rolling links */
a.hkd-link-2{line-height:44px;-webkit-perspective:1000px;-moz-perspective:1000px;perspective:1000px}
a.hkd-link-2 span{position:relative;display:inline-block;padding:0 14px;-webkit-transition:-webkit-transform .3s;-moz-transition:-moz-transform .3s;transition:transform .3s;-webkit-transform-origin:50% 0;-moz-transform-origin:50% 0;transform-origin:50% 0;-webkit-transform-style:preserve-3d;-moz-transform-style:preserve-3d;transform-style:preserve-3d}
a.hkd-link-2 span:before{position:absolute;top:100%;left:0;width:100%;height:100%;content:attr(data-hover);-webkit-transition:background .3s;-moz-transition:background .3s;transition:background .3s;-webkit-transform:rotateX(-90deg);-moz-transform:rotateX(-90deg);transform:rotateX(-90deg);-webkit-transform-origin:50% 0;-moz-transform-origin:50% 0;transform-origin:50% 0;text-align:center}
a:hover.hkd-link-2 span,a.hover.hkd-link-2 span{-webkit-transform:rotateX(90deg) translateY(-22px);-moz-transform:rotateX(90deg) translateY(-22px);transform:rotateX(90deg) translateY(-22px)}

/* Effect 3: bottom line */
a.hkd-link-3{padding:8px 0}
a.hkd-link-3:after{position:absolute;top:100%;left:0;width:100%;height:3px;content:'';opacity:0;-webkit-transition:opacity 0.3s,-webkit-transform .3s;-moz-transition:opacity 0.3s,-moz-transform .3s;transition:opacity 0.3s,transform .3s;-webkit-transform:translateY(10px);-moz-transform:translateY(10px);transform:translateY(10px)}
a:hover.hkd-link-3:after,a.hover.hkd-link-3:after{opacity:1;-webkit-transform:translateY(0px);-moz-transform:translateY(0px);transform:translateY(0px)}
	
/* Effect 4: second border slides up */
a.hkd-link-4{padding:12px 10px 10px;text-shadow:none;font-weight:700}
a.hkd-link-4:before,a.hkd-link-4::after{position:absolute;top:100%;left:0;width:100%;height:3px;content:'';-webkit-transition:-webkit-transform .3s;-moz-transition:-moz-transform .3s;transition:transform .3s;-webkit-transform:scale(0.85);-moz-transform:scale(0.85);transform:scale(0.85)}
a.hkd-link-4:after{opacity:0;-webkit-transition:top 0.3s,opacity 0.3s,-webkit-transform .3s;-moz-transition:top 0.3s,opacity 0.3s,-moz-transform .3s;transition:top 0.3s,opacity 0.3s,transform .3s}
a:hover.hkd-link-4:before,a:hover.hkd-link-4:after,a.hover.hkd-link-4:before,a.hover.hkd-link-4:after{-webkit-transform:scale(1);-moz-transform:scale(1);transform:scale(1)}
a:hover.hkd-link-4:after,a.hover.hkd-link-4:after{top:0;opacity:1}

/* Effect 5: reveal, push out */
a.hkd-link-5{overflow:hidden;margin:0 15px;position:relative;z-index:1}
a.hkd-link-5 span{display:block;padding:10px 20px;-webkit-transition:-webkit-transform .3s;-moz-transition:-moz-transform .3s;transition:transform .3s}
a.hkd-link-5:before{position:absolute;top:0;left:0;text-align:left;z-index:-1;padding:10px 20px;width:100%;height:100%;content:attr(data-hover);-webkit-transition:-webkit-transform .3s;-moz-transition:-moz-transform .3s;transition:transform .3s;-webkit-transform:translateX(-25%);-moz-transform:translateX(-25%);transform:translateX(-25%)}
a:hover.hkd-link-5 span,a.hover.hkd-link-5 span{-webkit-transform:translateX(100%);-moz-transform:translateX(100%);transform:translateX(100%)}
a:hover.hkd-link-5:before,a.hover.hkd-link-5:before{-webkit-transform:translateX(0%);-moz-transform:translateX(0%);transform:translateX(0%)}

/* Effect 6: text fill*/
a.hkd-link-6{padding:10px 0;text-shadow:none}
a.hkd-link-6:before{position:absolute;top:0;left:0;overflow:hidden;padding:10px 0;max-width:0;border-bottom:2px solid;content:attr(data-hover);-webkit-transition:max-width .5s;-moz-transition:max-width .5s;transition:max-width .5s}
a:hover.hkd-link-6:before,a.hover.hkd-link-6:before{max-width:100%}

/* Effect 7: border switch */
a.hkd-link-7{padding:0 20px;height:45px;line-height:45px}
a.hkd-link-7:before,a.hkd-link-7:after{position:absolute;width:45px;height:2px;content:'';opacity:.2;-webkit-transition:all .3s;-moz-transition:all .3s;transition:all .3s;pointer-events:none}
a.hkd-link-7:before{top:0;left:0;-webkit-transform:rotate(90deg);-moz-transform:rotate(90deg);transform:rotate(90deg);-webkit-transform-origin:0 0;-moz-transform-origin:0 0;transform-origin:0 0}
a.hkd-link-7:after{right:0;bottom:0;-webkit-transform:rotate(90deg);-moz-transform:rotate(90deg);transform:rotate(90deg);-webkit-transform-origin:100% 0;-moz-transform-origin:100% 0;transform-origin:100% 0}
a:hover.hkd-link-7:before,a:hover.hkd-link-7:after,a.hover.hkd-link-7:before,a.hover.hkd-link-7:after{opacity:1}
a:hover.hkd-link-7:before,a.hover.hkd-link-7:before{left:50%;-webkit-transform:rotate(0deg) translateX(-50%);-moz-transform:rotate(0deg) translateX(-50%);transform:rotate(0deg) translateX(-50%)}
a:hover.hkd-link-7:after,a.hover.hkd-link-7:after{right:50%;-webkit-transform:rotate(0deg) translateX(50%);-moz-transform:rotate(0deg) translateX(50%);transform:rotate(0deg) translateX(50%)}

/* Effect 8: cross */
a.hkd-link-8{padding:0 5px;font-weight:700;-webkit-transition:color .3s;-moz-transition:color .3s;transition:color .3s;position:relative;z-index:1}
a.hkd-link-8:before,a.hkd-link-8:after{position:absolute;width:100%;left:0;top:50%;height:2px;margin-top:-1px;content:'';z-index:-1;-webkit-transition:-webkit-transform 0.3s,opacity .3s;-moz-transition:-moz-transform 0.3s,opacity .3s;transition:transform 0.3s,opacity .3s;pointer-events:none}
a.hkd-link-8:before{-webkit-transform:translateY(-20px);-moz-transform:translateY(-20px);transform:translateY(-20px)}
a.hkd-link-8:after{-webkit-transform:translateY(20px);-moz-transform:translateY(20px);transform:translateY(20px)}
a:hover.hkd-link-8:before,a:hover.hkd-link-8:after,a.hover.hkd-link-8:before,a.hover.hkd-link-8:after{opacity:.7}
a:hover.hkd-link-8:before,a.hover.hkd-link-8:before{-webkit-transform:rotate(45deg);-moz-transform:rotate(45deg);transform:rotate(45deg)}
a:hover.hkd-link-8:after,a.hover.hkd-link-8:after{-webkit-transform:rotate(-45deg);-moz-transform:rotate(-45deg);transform:rotate(-45deg)}

/* variables */
a.hkd-link-4:before,a.hkd-link-4:after,a.hkd-link-3:after,a:hover.hkd-link-8:after,a:hover.hkd-link-8:before,a.hover.hkd-link-8:after,a.hover.hkd-link-8:before{background:rgba(0,0,0,0.1)}
a.hkd-link-6{border-top:2px solid rgba(0,0,0,.05)}
a.hkd-link.hkd-link-6{color:rgba(0,0,0,.25)}
a.hkd-link-2 span,a:hover.hkd-link-2 span:before,a.hover.hkd-link-2 span:before,a.hkd-link-5 span,a.hkd-link-5:before{color:#fff}			
			
/* Accordion ------------------------------------------------------------------------- */
.accordion .question{margin-bottom:5px;-webkit-border-radius:5px;border-radius:5px;overflow:hidden;border-width:1px;border-style:solid}
.accordion .question:last-child{margin-bottom:0}
.accordion .question .title{padding:14px 14px 14px 60px;font-size:13px;font-weight:700;position:relative;border-width:0;border-style:solid;cursor:pointer;background-image:url(/23e4bb9bcd0b199cc3eeeaa243d4c592.png);background-repeat:repeat-x;background-position:left top}
.accordion .question .title:before{content:"";width:49px;height:100%;border-width:0 1px 0 0;border-style:solid;position:absolute;left:0;top:0;z-index:1}
.accordion .question .title > .acc-icon-plus,.accordion .question .title > .acc-icon-minus{font-size:17px;line-height:17px;display:block;position:absolute;left:15px;top:16px;width:20px;height:20px;text-align:center;color:rgba(0,0,0,.25)}
.accordion .question .title > .acc-icon-plus:before,.accordion .question .title > .acc-icon-minus:before{margin:0!important}
.accordion .question .title > .acc-icon-plus{display:block}
.accordion .question .title > .acc-icon-minus{display:none}
.accordion .question .answer{padding:15px 20px 20px;overflow:hidden;display:none;background-image:url(/8bf548cc42bf2004de4c0f91781fe88a.png);background-repeat:repeat-x;background-position:left top}
.accordion .question .answer .wpb_content_element:last-child{margin-bottom:0}
.accordion .question.active .title{border-width:0 0 1px}
.accordion .question.active .title > .acc-icon-plus{display:none}
.accordion .question.active .title > .acc-icon-minus{display:block}
.accordion .question.active p:last-child{margin-bottom:0}

/* FAQ ------------------------------------------------------------------------------- */
.faq .question{margin-bottom:5px;overflow:hidden;position:relative;background:rgba(0,0,0,.02)}
.faq .question:before{content:"";width:60px;height:100%;border-width:0 1px 0 0;border-style:solid;border-color:rgba(0,0,0,.1);position:absolute;left:0;top:0;z-index:1}
